script: |
  super -f text -I q1632.spq | sort > q1632.out

inputs:
  - name: q1632.spq
    data: |
      SELECT - 78 + + col0 * col1 AS col1 FROM tab2 (FORMAT parquet) WHERE col1 * - col0 - + col0 * - col0 / - - 82 + + col0 * col1 + - + 75 + - col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q1632.out
    data: |
      2268
      4850
      4947
